#E468-MJMAIN-221A" x="0" y="44"></use><rect stroke="none" width="1000" height="60" x="833" y="784"></rect><g transform="translate(833,0)"><use xlink:href="#E468-MJMAIN-36"></use><use xlink:href="#E468-MJMAIN-39" x="500" y="0"></use></g></g></g></g></g></g></g></g></g></g></g></svg></span></div><script type="math/tex; mode=display" id="MathJax-Element-459">\newcommand{\v}[3]{\left<#1,\ #2,\ #3\right>}
\newcommand{\m}[1]{\left\|#1\right\|}
\newcommand{\align}[1]{\begin{aligned}#1\end{aligned}}
\newcommand{\par}[1]{\left(#1\right)}

\align{
	&\align{
		&r_1(t)=\v{3t}{2t^2}{t^3}
		&r_2(t)=\v{ t}{4t^2}{t^2}
	}

	\\\\\\

	&r_1(t)\text{ and }r_2(t)\text{ start at the origin and represent two cross-country paths.}
	\\
	&\text{Each race is }3\text{ miles long.}

	\\\\\\

	&\text{a) Find the finish line for each track.}
	\\
	&\align{
		s(t) &= \int_0^t\m{v(u)}\ du
		\\
		\\ s_1(t) &= \int_0^t \m{\v{3}{4u}{3u^2}} \ du
		&  s_2(t) &= \int_0^t \m{\v{1}{8u}{2u  }} \ du
		\\ s_1(t) &= \int_0^t \sqrt{9u^4+16u^2+9} \ du
		&  s_2(t) &= \int_0^t \sqrt{     68u^2+1} \ du
		\\ s_1(t) &= 3
		&  s_2(t) &= 3
		\\ t      &= 0.827
		&  t      &= 0.826
		\\ r_1(t) &= \v{2.481}{1.367}{0.565}
		&  r_2(t) &= \v{0.826}{2.727}{0.682}
	}

	\\\\\\

	&\text{b) Which track has the greatest curvature and what and where is it?}
	\\
	&\align{
		\kappa(t) &= \frac{\m{v(t)\times a(t)}}{\m{v(t)}^3}
		\\
		\\ v_1(t)                  &= \v{3}{4t}{3t^2}
		&  v_2(t)                  &= \v{1}{8t}{2t  }
		\\ a_1(t)                  &= \v{0}{4}{6t}
		&  a_2(t)                  &= \v{0}{8}{2 }
		\\ v_1(t)\times a_1(t)     &= \v{12t^2}{-18t}{12}
		&  v_2(t)\times a_2(t)     &= \v{0    }{-2  }{8 }
		\\ \m{v_1(t)\times a_1(t)} &= 6\sqrt{4t^4+9t^2+4}
		&  \m{v_2(t)\times a_2(t)} &= 2\sqrt{         17}
		\\ \m{v_1(t)}^3            &= \par{9t^4+16t^2+9}^\frac32
		&  \m{v_2(t)}^3            &= \par{68t^2+1}^\frac32
		\\ \kappa_1(t)             &= \frac{6\sqrt{4t^4+9t^2+4}}{\par{9t^4+16t^2+9}^\frac32}
		&  \kappa_2(t)             &= \frac{2\sqrt{17}}{\par{68t^2+1}^\frac32}
		\\ \max                    &= \par{0,\  \frac49}
		&  \max                    &= \par{0,\ 2\sqrt{17}}
	}
	\\
	&r_2\text{ at the origin, with a curvature of }2\sqrt{17}

	\\\\\\

	&\text{c) Find }a_N\text{ and }a_T\text{ at }t=1\text{ for each path.}
	\\
	&\align{
		  a_T(t) &= \frac{d}{dt}\m{v(t)}
		& a_N(t) &= \sqrt{\m{a(t)}^2-a_T(t)^2}
		\\
		\\ a_1(t)     &= \v{0}{ 4}{6t}
		&  a_2(t)     &= \v{0}{-2}{8 }
		\\ a_1(1)     &= \v{0}{ 4}{6 }
		&  a_2(1)     &= \v{0}{-2}{8 }
		\\ \m{a_1(1)} &= 2\sqrt{13}
		&  \m{a_2(1)} &= 2\sqrt{17}
		\\ \m{v_1(t)} &= \sqrt{9t^4+16t^2+9}
		&  \m{v_2(t)} &= \sqrt{     68t^2+1}
		\\ a_{1T}(t)  &= \frac{18t^3+16t}{\sqrt{9t^4+16t^2+9}}
		&  a_{2T}(t)  &= \frac{      68t}{\sqrt{     68t^2+1}}
		\\ a_{1T}(1)  &= \sqrt{34}
		&  a_{2T}(1)  &= \frac{68}{\sqrt{69}}
		\\ a_{1N}(1)  &= \sqrt{4\cdot13-34             }=\sqrt{18}
		&  a_{2N}(1)  &= \sqrt{4\cdot17-\frac{68^2}{69}}=\frac{\sqrt{68}}{\sqrt{69}}
	}
}</script></div></div></div>
